import React from "react";
import { Container, Grid, Typography, TextField, TextareaAutosize } from '@mui/material';
import contact_form from '../images/contact_form.png';


export default function Contact() {
    // Set initial form state
    const [formData, setFormData] = useState({
      name: '',
      email: '',
      message: ''
    });

    // Handle form input changes
    const handleChange = (e) => {
      setFormData({
        ...formData,
        [e.target.name]: e.target.value
      });
    };

    // Handle form submission
    const handleSubmit = (e) => {
      e.preventDefault();
      console.log('Form Data Submitted:', formData);
      // Add form submission logic (e.g., send data to API)
    };



    return(
        <div>
            <Container disableGutters maxWidth={false} className='dark_gray_bg pb_50 pt_100 contact_form'>
<Container fixed>

<Grid container spacing={5}>
<Grid item xs={6}>
<img src={contact_form} alt="Contact" />
    </Grid>
    <Grid item xs={6}>

    <Typography gutterBottom variant="h4" component="div">
Get in touch
</Typography>
<form onSubmit={handleSubmit}>
      <div>
        <label>Name:</label>
        <input
          type="text"
          name="name"
          value={formData.name}
          onChange={handleChange}
        />
      </div>
      <div>
        <label>Email:</label>
        <input
          type="email"
          name="email"
          value={formData.email}
          onChange={handleChange}
        />
      </div>
      <div>
        <label>Message:</label>
        <textarea
          name="message"
          value={formData.message}
          onChange={handleChange}
        />
      </div>
      <button type="submit">Submit</button>
    </form>
    </Grid>
    </Grid>
    </Container>
    </Container>
        </div>
    )
}
